import React from 'react';
import 'tachyons'

const Card = ({name, email, id}) => {

	return(
		<div className="tc bg-lightest-blue dib br3 pa3 ma2 grow bw2 shadow-5">
			<img alt='robo_photo' src={`https://robohash.org/${id}?200x200`}/>
			<div>
				<h2>{name}</h2>
				<p>{email}</p>
			</div>
		</div>
	);
}

export default Card;
